import styled from '@emotion/styled';
import { Layout } from 'antd';

const { Footer } = Layout;

export default styled(Footer)({
    textAlign: 'center',
    backgroundColor: '#e4e6e8',
    position: 'fixed',
    bottom: '0',
    width: '100vw'
});
